/**
 * Check if an official icon exists for the given icon type
 */
export function hasOfficialIcon(iconType: string): boolean {
  return iconType in CLOUD_ICON_PATHS;
}

/**
 * Get the path to an official icon, or undefined if not found
 */
export function getOfficialIconPath(iconType: string): string | undefined {
  return CLOUD_ICON_PATHS[iconType];
}
